import React from 'react';
import "./style.css"


function Restaurant() {
  return (
    <div>
        <div className="card-container">
            <div className="card">
                <div className="card-body">
                    <span className="card-number card-circle subtle">1</span>
                </div>
            </div>
        </div>
    </div>
  )
}

export default Restaurant
